import React from 'react';

const NavBar = () => {
    return (
        <nav class="navbar navbar-danger bg-light">
          <div class="container-fluid">
            <span class="navbar-brand mb-0 h1">Navbar</span>
          </div>
        </nav>
    );
};

export default NavBar;
